import styled from "styled-components";

const StyledHeader = styled.div`
    position: absolute;
    top: 0;


  width: 100%;
  height: 45px;

  background: rgb(66, 255, 0, 0.6);

  display: flex;
  justify-content: space-between;
  align-items: center;
`;

const Header = () => {
  return (
    <StyledHeader>
      <p
        style={{
          fontSize: "16px",
          fontWeight: 700,
          letterSpacing: "2px",
          marginLeft: "22px",
        }}
      >
        ACTIVE GAMES (4)
      </p>
    </StyledHeader>
  );
};

export default Header;
